description:
And here you go, DarthScanners version of Eagles of Rome.

Even if Marcus and Arminius are parted, the Emperor Augustus account on the strength of the friendship that unites them that light be shed on the rumour that shook Rome. He sends Marcus on a secret mission to Germania, cradle of Arminius, to determine the involvement of him in the preparation of a rebellion of his people. But treason and conspiracy are not the preserve of the barbarians.
